Recall from Chapter 6 the central idea behind gradient-based techniques used for optimization challenges. These methods start from an initial approximation \( \mathbf{x}(0) \in \mathbb{R}^n \), then methodically produce a series of improved approximations \( \mathbf{x}(1), \mathbf{x}(2), \mathbf{x}(3), \ldots \) following the general update formula \( \mathbf{x}(t+1) = \mathbf{x}(t) + \eta \mathbf{v}(t) \) for a certain search direction \( \mathbf{v}(t) \) and a step size \( \eta \). Chapter 6 highlights gradient descent, which utilizes the function's gradient to steer its discoveries. In this chapter, we will redevelop descent-based optimization techniques and present alternative updating systems. We're here focusing on coordinate descent, a subset of descent-based methodologies honors an iterative approach to minimize multivariable functions by serially reducing it along individual axes one at a time. We consider the general optimization challenge expressed as \( p^* = \min_{\mathbf{x} \in \mathbb{R}^n} f(\mathbf{x}) \), with the optimization variable represented as \( \mathbf{x} = \begin{bmatrix} x_1 \\ x_2 \\ \vdots \\ x_n \end{bmatrix} \). Before unveiling the algorithm, we establish some notations; for indices \( i \) and \( j \), we introduce the notation \( \mathbf{x}_{i:j} = (x_i, x_{i+1}, \ldots, x_j) \in \mathbb{R}^{j-i+1} \) indicating the entries of \( \mathbf{x} \) from index \( i \) to \( j \) inclusively. Beginning from an initial estimate \( \mathbf{x}(0) \), and for \( t \geq 0 \), the coordinate descent scheme alters the iterate \( \mathbf{x}(t) \) through sequential minimization of \( f(\mathbf{x}) \) in regard to each variable—an update formula for the \( i_th \) element can be akin to using \( x(i+1) \equiv \min_{x_i \in R} f(\mathbf{x}_{1:i-1}^{(t+1)}, x_i, \mathbf{x}_{i+1:n}^{(t)}) \). Accordingly, we first update \( x(1)_1 \) after minimizing along dimension one, proceeding similarly through to \( x(n) \in \arg\min _{x_n \in \mathbb{R}} f(\mathbf{x}_{1:n-1}^{(t+1)}, x_n) \). 

